export default class Header extends Component {

    render() {
        if(CustomEditConfig.isEmpty(this.props)) {
            return null;
        }

        return (
            <div className="DemoComponent">
                <h2 className="DemoComponent__name">{this.props.logo}</h2>

                <div className="DemoComponent__navbar">
                {this.props.link.map(
                    item => (
                            <ul key={item.id}><h4>{item.name}, {item.url}</h4>

                            </ul>
                    )
                )}
                </div>
            </div>
        );
    }
  };


MapTo('spa-react/components/content/header')(Header,CustomEditConfig);
